import {Component} from "react";

export class PrioritySelector extends Component{
    render(){
    const [title, parentChangeHandler, parentValue, options] = this.props;
    return (<label>{title}
                <select onChange={parentChangeHandler}
                        value={parentValue}>
                    {options.map(option=> <option {...option}/>)}
                </select>
            </label>)
}
}
